import './style.css'

function Botton() {
    return(
        <div id="slider-controls" className="slider-controls">
    <span id="addition" className="addition">اضافه دوله </span>
    <span id="ascending" className="ascending">ترتيب تصاعدي</span>
    <span id="letters" className="letters">ترتيب حسب الحروف</span>
    <span id="desecending" className="desecending">ترتيب تنازلي</span>
    
    </div>
    )
    
}

export default Botton;
